import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";
import { Menu, Input, Row, Col } from "antd";

const AppLayout = ({ children }) => {
    return (
        <div>
            <Menu mode="horizontal">
                <Menu.Item>
                    <Link href="/">
                        <a>노드버드</a>
                    </Link>
                </Menu.Item>
                <Menu.Item>
                    <Link href="/profile">
                        <a>프로필</a>
                    </Link>
                </Menu.Item>
                <Menu.Item>
                    <Input.Search
                        placeholder="input search text"
                        enterButton
                        style={{
                            verticalAlign: "middle",
                        }}
                    ></Input.Search>
                </Menu.Item>
                <Menu.Item>
                    <Link href="/signup">
                        <a>회원가입</a>
                    </Link>
                </Menu.Item>
            </Menu>
            <Row gutter={8}>
                <Col
                    xs={24}
                    sm={6}
                    md={6}
                    style={{ border: "1px solid black" }}
                >
                    왼쪽메뉴
                </Col>
                <Col
                    xs={24}
                    sm={12}
                    md={12}
                    style={{ border: "1px solid black" }}
                >
                    {children}
                </Col>
                <Col
                    xs={24}
                    sm={6}
                    md={6}
                    style={{ border: "1px solid black" }}
                >
                    <a href="https://github.com/zinozino1">Made by zino</a>
                </Col>
            </Row>
        </div>
    );
};

AppLayout.propTypes = {
    children: PropTypes.node.isRequired,
};

export default AppLayout;
